import { useMemo } from 'react';
import { useLocation } from 'react-router-dom';
import {
  Avatar,
  Box,
  IconButton,
  InputAdornment,
  OutlinedInput,
  Tooltip,
  Typography
} from '@mui/material';
import MenuRoundedIcon from '@mui/icons-material/MenuRounded';
import SettingsRoundedIcon from '@mui/icons-material/SettingsRounded';
import SearchRoundedIcon from '@mui/icons-material/SearchRounded';
import ChevronLeftRoundedIcon from '@mui/icons-material/ChevronLeftRounded';
import ChevronRightRoundedIcon from '@mui/icons-material/ChevronRightRounded';

const routeMeta = [
  {
    match: /^\/admin\/songs/,
    title: 'Manage Songs',
    subtitle: 'Curate, edit, and keep the catalog fresh'
  },
  {
    match: /^\/admin/,
    title: 'Admin Dashboard',
    subtitle: 'Monitor health across your music platform'
  },
  {
    match: /^\//,
    title: 'Good evening',
    subtitle: 'Let the music find your mood'
  }
];

const Topbar = ({ onMenuToggle, onCollapseToggle, sidebarCollapsed, isDesktop }) => {
  const location = useLocation();

  const { title, subtitle } = useMemo(() => {
    const match = routeMeta.find((item) => item.match.test(location.pathname));
    return match || routeMeta[routeMeta.length - 1];
  }, [location.pathname]);

  return (
    <Box
      component="header"
      sx={{
        position: 'sticky',
        top: 0,
        zIndex: 1200,
        borderBottom: '1px solid rgba(255,255,255,0.06)',
        backdropFilter: 'blur(8px)',
        backgroundColor: 'rgba(15,15,15,0.78)'
      }}
    >
      <Box
        sx={{
          display: 'grid',
          gridTemplateColumns: {
            xs: 'auto 1fr auto',
            md: isDesktop ? 'auto minmax(320px, 1fr) auto' : 'auto 1fr auto'
          },
          alignItems: 'center',
          gap: { xs: 1.5, md: 2.5 },
          px: { xs: 2, md: 3 },
          py: 2
        }}
      >
        <Box display="flex" alignItems="center" gap={isDesktop ? 1 : 1.5}>
          <IconButton
            aria-label="Toggle navigation"
            onClick={onMenuToggle}
            sx={{
              display: { md: 'none' },
              color: 'text.primary'
            }}
          >
            <MenuRoundedIcon />
          </IconButton>

          {isDesktop && (
            <Tooltip title={sidebarCollapsed ? 'Expand sidebar' : 'Collapse sidebar'}>
              <IconButton
                aria-label={sidebarCollapsed ? 'Expand sidebar' : 'Collapse sidebar'}
                onClick={onCollapseToggle}
                sx={{
                  color: 'text.secondary',
                  backgroundColor: 'rgba(255,255,255,0.04)',
                  '&:hover': { backgroundColor: 'rgba(255,255,255,0.08)' }
                }}
              >
                {sidebarCollapsed ? <ChevronRightRoundedIcon /> : <ChevronLeftRoundedIcon />}
              </IconButton>
            </Tooltip>
          )}

          <Box>
            <Typography variant="h5" sx={{ fontWeight: 600 }}>
              {title}
            </Typography>
            <Typography variant="body2" color="text.secondary">
              {subtitle}
            </Typography>
          </Box>
        </Box>

        <OutlinedInput
          fullWidth
          placeholder="Search songs, artists, moods..."
          sx={{
            display: { xs: 'none', sm: 'flex' },
            backgroundColor: 'rgba(255,255,255,0.04)',
            borderRadius: '999px',
            '& fieldset': {
              border: '1px solid rgba(255,255,255,0.08)'
            },
            '&:hover fieldset': {
              borderColor: 'rgba(255,255,255,0.14)'
            },
            '&.Mui-focused fieldset': {
              borderColor: 'rgba(29,185,84,0.8)',
              boxShadow: '0 0 0 4px rgba(29,185,84,0.18)'
            }
          }}
          startAdornment={
            <InputAdornment position="start">
              <SearchRoundedIcon sx={{ color: 'rgba(255,255,255,0.6)' }} />
            </InputAdornment>
          }
        />

        <Box display="flex" alignItems="center" gap={1.5} justifyContent="flex-end">
          <Tooltip title="Settings">
            <IconButton aria-label="Open settings" sx={{ color: 'text.secondary' }}>
              <SettingsRoundedIcon />
            </IconButton>
          </Tooltip>
          <Avatar
            sx={{
              width: 36,
              height: 36,
              bgcolor: 'rgba(29,185,84,0.25)',
              color: 'primary.main',
              fontWeight: 600,
              border: '1px solid rgba(29,185,84,0.45)'
            }}
            alt="User" 
          >
            JD
          </Avatar>
        </Box>
      </Box>
    </Box>
  );
};

export default Topbar;
